	const focusCity = (city) => {
		city.node.style.opacity = 0.4;
		document.getElementById('cidade').innerHTML = city.data('id');
	}

	const unFocusCity = (city) => {
		city.node.style.opacity = 1;
	}

	const addEvents = (city) => {
		city.mouseover(() => focusCity(city));
		city.mouseout(() => unFocusCity(city));
	}

	Array.from(cidades).forEach(addEvents);
